import React from 'react';
import {
  Box,
  Typography,
  Paper,
  Card,
  CardContent,
  CardActions,
  Button,
} from '@mui/material';
import { useNavigate } from 'react-router-dom';
import { useLanguage } from '../../contexts/LanguageContext';

interface StatCardProps {
  title: string;
  value: string | number;
  description: string;
  link: string;
}

const StatCard: React.FC<StatCardProps> = ({ title, value, description, link }) => {
  const navigate = useNavigate();
  const { t } = useLanguage();

  return (
    <Card>
      <CardContent>
        <Typography color="textSecondary" gutterBottom>
          {t(title)}
        </Typography>
        <Typography variant="h4" component="div">
          {value}
        </Typography>
        <Typography variant="body2" color="textSecondary">
          {t(description)}
        </Typography>
      </CardContent>
      <CardActions>
        <Button size="small" onClick={() => navigate(link)}>
          {t('viewDetails')}
        </Button>
      </CardActions>
    </Card>
  );
};

const Dashboard: React.FC = () => {
  const { t } = useLanguage();

  const stats = [
    {
      title: 'totalTasks',
      value: 24,
      description: 'activeDevelopmentTasks',
      link: '/development-platform',
    },
    {
      title: 'resources',
      value: 156,
      description: 'availableResources',
      link: '/resources',
    },
    {
      title: 'teamMembers',
      value: 12,
      description: 'activeTeamMembers',
      link: '/team',
    },
    {
      title: 'projects',
      value: 8,
      description: 'ongoingProjects',
      link: '/projects',
    },
  ];

  return (
    <Box>
      <Typography variant="h4" component="h1" gutterBottom>
        {t('dashboard')}
      </Typography>
      <Box sx={{ display: 'grid', gridTemplateColumns: { xs: '1fr', sm: '1fr 1fr', md: '1fr 1fr 1fr 1fr' }, gap: 3 }}>
        {stats.map((stat) => (
          <Box key={stat.title}>
            <StatCard {...stat} />
          </Box>
        ))}
      </Box>
    </Box>
  );
};

export default Dashboard;
